export async function getData() {
  return await fetch('https://techstars-api.herokuapp.com/api/meetings')
    .then((data) => data.json())
    .catch((error) => console.error(error));
}
export async function getName() {
  await fetch(
    `https://techstars-api.herokuapp.com/api/mentors/3cf43bbc-9836-4dfd-97db-f06aa49df1da`
  )
    .then((name) => {
      return name.json();
    })
    .catch((e) => {
      console.error(e);
    });
}
